const canvas = document.getElementById("canvas");
const text = document.getElementById("text");
const menu = document.getElementById("menu");
const ctx = canvas.getContext("2d");

onresize = function () {
	canvas.width = document.body.offsetWidth;
	canvas.height = document.body.offsetHeight;
}
onresize();

function sleep (ms) {
	return new Promise((resolve) => {
  		setTimeout(() => resolve(), ms);
	})
}

Element.prototype.create = function (tag, className) {
	let element = document.createElement(tag);
	if (className)
		element.className = className;
	this.appendChild(element);
	return element;
}

class Level {
	static level = 0;
	static broadcasting = false;
	constructor (name, obstacles = [], sprites = [], start = [0, 0]) {
		this.name = name;
		this.obstacles = obstacles;
		this.sprites = sprites;
		this.start = start;
	}
	static async broadcast (string, temporary) {
		if (temporary) {
			if (!Level.broadcasting) {
				Level.broadcasting = true;
				text.textContent = string;
				await sleep(2000);
				if (Level.level)
					text.textContent = "";
				Level.broadcasting = false;
			}
		} else
			text.textContent = string;
	}
	static setLevel (level) {
		Level.level = level;
		Level.broadcast(levels[level].name, level);
		menu.style.display = level ? "none" : "";
		for (let i = 0; i < levels.length; i++) {
			if (i == level)
				continue;
			for (let obstacle of levels[i].obstacles)
				obstacle.container.style.transform = "scale(0)";
		}
		player.size = [0, 0];
		player.setSize([50, 50], 10);
		player.setPosition(levels[Level.level].start);
	}
	static levelUp () {
		Level.setLevel((Level.level + 1) % levels.length);
	}
}

class Sprite {
	constructor (src, size=[50, 50], pos = [0, 0], scale = [1, 1], collisions = true) {
		this.img = new Image();
		this.img.src = src;
		this.pos = pos;
		this.size = size;
		this.sizeAnimation = null;
		this.scale = scale;
		this.collisions = collisions;
		this.animation = {};
	}
	setSize (size, frames) {
		this.sizeAnimation = {
			size,
			frames,
			frame: 0,
			step: size.map((v, i) => (v - this.size[i]) / frames)
		}
	}
	animate (aspect, value, frames, listener) {
		this.animation[aspect] = {
			value,
			frames,
			frame: 0,
			step: value.map((v, i) => (v - this[aspect][i]) / frames),
			listener
		}
	}
	setPosition (pos) {
		this.pos = pos;
	}
	move (pos) {
		this.setPosition(this.pos.map((v, i) => v + pos[i]));
	}
	draw () {
		let mappedPos = this.pos.map((v, i) => v - player.pos[i] + (canvas[i ? "height" : "width"] - player.size[i]) / 2);
		mappedPos[1] = canvas.height - mappedPos[1] - this.size[1];
		ctx.save();
		ctx.translate(...mappedPos.map((v, i) => v + this.size[i] / 2));
		ctx.scale(...this.scale);
		ctx.drawImage(this.img, 0, 0, this.img.width, this.img.height, ...this.size.map(v => -v / 2), ...this.size);
		ctx.restore();
	}
}

