class Player extends Sprite {
	static canJump = true;
	setPosition (pos) {
		super.setPosition(pos);
		let level = levels[Level.level];
		for (let sprite of level.sprites) {
			if (sprite.collisions) {
				if ((sprite.pos[0] - player.size[0]) <= player.pos[0] && player.pos[0] <= (sprite.pos[0] + sprite.size[0])
				&& sprite.pos[1] <= player.pos[1] && player.pos[1] <= (sprite.pos[1] + sprite.size[1])) {
					if (sprite instanceof Flagpole)
						Level.levelUp();
					else if (sprite instanceof Enemy)
						Level.setLevel(Level.level);
					else {
						player.pos[1] = sprite.pos[1] + sprite.size[1];
						Player.canJump = true;
						if (velocity < 0)
							velocity /= -2;
						if (velocity < 3)
							velocity = 0;
					}
				}
			}
		}
		if (this.pos[1] < -(200 + this.size[1]))
			Level.setLevel(Level.level);
		for (let obstacle of levels[Level.level].obstacles)
			obstacle.container.style.transform = obstacle.bounds[0] <= player.pos[0] && player.pos[0] <= obstacle.bounds[1] ? "" : "scale(0)";
	}
}

class Enemy extends Sprite {
	constructor (pos, patrolRange) {
		super("data:image/png;base64,", [75, 75], pos)
		let forward;
		let animation = () => {
			forward = +!forward;
			let copy = [...pos];
			copy[0] += forward * (patrolRange - this.size[0]);
			this.animate("pos", copy, 120, animation);
			this.animate("scale", [(-1) ** forward, 1], 10)
		}
		animation();
	}
}

const player = new Player("data:image/png;base64,");

class Obstacle {
	constructor (bounds, animations, problems) {
		this.container = document.body.create("div", "obstacle");
		this.bounds = bounds;
		this.problems = problems;
		this.animations = animations;
		this.correct = 0;
	}
	createInput (element, answer, className) {
		element.create("input", className).oninput = event => {
			if (event.target.value == answer) {
				this.correct++;
				event.target.setAttribute("readonly", "");
				if (this.correct == this.problems) {
					this.container.style.opacity = .8;
					for (let animation of this.animations)
						animation[0].setSize(animation[1], animation[2]);
				}
			}
		}
	}
	static randomInt (low, high) {
		return Math.floor(Math.random() * (high - low + 1)) + low;
	}
}

