// Level 2: Derivative Desert

class Derivative extends Obstacle {
	constructor (bounds, animations, size, maxCoefficient = 9, maxOrder = 5) {
		super(bounds, animations, size * 2);
		for (let i = 0; i < size; i++) {
			let coefficient = Obstacle.randomInt(2, maxCoefficient);
			let power = Obstacle.randomInt(2, maxOrder);
			let div = this.container.create("div");
			div.create("b").innerHTML = `<sup>d</sup>&frasl;<sub>dx</sub> (${coefficient}x<sup>${power}</sup>)<hr>`;
			let response = div.create("div", "response");
			this.createInput(response, coefficient * power);
			response.create("b").textContent = " x ";
			this.createInput(response.create("sup"), power - 1);
		}
	}
}

class Text extends Obstacle {
    constructor (bounds, animations, question, answer) {
		super(bounds, animations, 1);
		this.container.create("b").textContent = question;
		this.createInput(this.container, answer);
	}
}

