let velocity = 0;
let acceleration = 1;
let jumpIntensity = 25;
let moveIntensity = 10;

let keyPresses = {
	" ": false,
	"w": false,
	"a": false,
	"d": false
}
onkeydown = function (event) {
	if (event.key in keyPresses)
		keyPresses[event.key] = true;
}
onkeyup = function (event) {
	if (event.key in keyPresses)
		keyPresses[event.key] = false;
	else if (event.key == "Escape")
		Level.setLevel(0);
}

