function clearCanvas () {
	ctx.clearRect(0, 0, canvas.width, canvas.height);
	let img = new Image();
	img.src = "data:image/png;base64,";
	ctx.fillStyle = ctx.createPattern(img, "repeat");
	ctx.fillRect(0, 0, canvas.width, canvas.height);
	ctx.fillStyle = "white";
}

function drawFrame () {
	clearCanvas();
	if (Level.level) {
		velocity -= acceleration;
		for (let key in keyPresses) {
			if (keyPresses[key]) {
				switch (key) {
					case " ":
					case "w":
						if (Player.canJump) {
							velocity = jumpIntensity;
							Player.canJump = false;
						}
						break;
					case "a":
						player.move([-moveIntensity, 0]);
						if (player.scale[0] > 0)
							player.animate("scale", [-1, 1], 10)
						break;
					case "d":
						player.move([moveIntensity, 0]);
						if (player.scale[0] < 0)
							player.animate("scale", [1, 1], 10)
						break;
				}
			}
		}
		player.move([0, velocity]);
		const level = levels[Level.level];
		for (let sprite of [...level.sprites, player]) {
			if (sprite.sizeAnimation) {
				let { size, frames, frame, step } = sprite.sizeAnimation;
				if (frame == frames) {
					sprite.size = size;
					sprite.sizeAnimation = null;
				} else {
					sprite.size = sprite.size.map((v, i) => v + step[i]);
					sprite.sizeAnimation.frame++;
				}
			}
			// actual animation
			for (let aspect in sprite.animation) {
				let { value, frames, frame, step, listener } = sprite.animation[aspect];
				if (frame == frames) {
					sprite[aspect] = value;
					delete sprite.animation[aspect];
					if (listener)
						listener();
				} else {
					sprite[aspect] = sprite[aspect].map((v, i) => v + step[i]);
					sprite.animation[aspect].frame++;
				}
			}
			sprite.draw();
		}
		player.draw();
	}
}

let running = true;
const pseudoFPS = 60;
const frameSpacing = 1000 / pseudoFPS;
async function init () {
	Level.setLevel(0);
	while (running) {
		drawFrame();
		await sleep(frameSpacing);
	}
}
init();